import React from "react";
import ReactDOM from "react-dom";
import "./grid.css";
import NavBar from "./components/NavBar";
import "./App.css";
import Greeting from "./components/Greeting";
import PortContent from "./components/PortContent";
import PortContentList from "./components/PortContentList";
import AboutMe from "./components/AboutMe";
import CommentList from "./components/CommentList";
import SkillSet from "./components/SkillSet";
import Header from "./components/Header";
import SkillList from "./components/SkillList";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      navBar: ["TRANG CHỦ", "PORTFOLIO", "RESUME", "VỀ TÔI", "LIÊN HỆ"],
      linkContent: ["Mockup", "Poster", "Pics", "Ấn phẩm", "Truyền thông"],
    };
  }

  render() {
    return (
      <div className="body">
        <div className="cover">
          <NavBar content={this.state.navBar} />
          <Greeting />
        </div>

        <div className="content">
          <div className="my-skill">
            <SkillList />
          </div>
          <div className="portfolio">
            <Header title="Sản phẩm " titleEmph="đã từng thực hiện" />
            <NavBar content={this.state.linkContent} />
            <PortContentList />
          </div>

          <div className="about-me">
            <AboutMe />
          </div>

          <div className="comment">
            <Header
              title="Nhận xét từ "
              titleEmph="khách hàng và cựu đồng nghiệp"
            />
            <CommentList />
          </div>
        </div>
      </div>
    );
  }
}
export default App;
